import React from 'react';
import { ChakraProvider, extendTheme } from '@chakra-ui/react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Index from './components/Index';
import Navbar from './components/navbar';
import Login from './components/Login';
import Register from './components/Register';
import Info1 from './components/Info1';
import Info2 from './components/Info2';
import Info3 from './components/Info3';
import Info4 from './components/Info4';
import Info5 from './components/Info5';
import Index2 from './components/Index2';
import Pricing from './components/pricing';
import Tester from './components/tester';
import IndexPage from './components/tester';
import Tester2 from './components/tester2';
import Tester3 from './components/tester3';
// Extend the theme to include custom colors, fonts, etc
const theme = extendTheme({
  config: {
    initialColorMode: 'dark',
    useSystemColorMode: false,
  },
  // Add any other theme customizations here
});

function App() {
  return (
    <ChakraProvider theme={theme}>
      <Router>
        <Routes>
          <Route path="/" element={<Index />} />
          <Route path="/index" element={<Index />} />
          <Route path="/index2" element={<Index2 />} />
          <Route path="/info1" element={<Info1 />} />
          <Route path="/info2" element={<Info2 />} />
          <Route path="/info3" element={<Info3 />} />
          <Route path="/info4" element={<Info4 />} />
          <Route path="/info5" element={<Info5 />} />
          <Route path="/pricing" element={<Pricing />} />
          <Route path="/tester3" element={<Tester3 />} />
          <Route path="/tester" element={<IndexPage />} />
          {/* Remove or comment out the /tester2 route */}
          {/* <Route path="/tester2" element={<Tester2 />} /> */}
          <Route path="/login" element={<><Navbar /><Login /></>} />
          <Route path="/register" element={<><Navbar /><Register /></>} />
        </Routes>
      </Router>
    </ChakraProvider>
  );
}

export default App;
